const image = document.querySelector(".carousel img")
const array = ["https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ_Cbg5QJI9WMG1Uhmcwi9IMHZTFZnt5uZHYg&s","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS0Pa-uqx4lclMXU2GtbsiJtKQHl4BOTFJXiQ&s","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRwt81xmayHfzRE80rt1ja91y4gi0ypiy_QNw&s","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRUYgq-kFjCj__04KXRwby4tCFCAmUEx_XpwA&s","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSowqby6gqgRc3jZv4LwxKwMa2IhrbGOLy0sQ&s","data:image/jpeg;base64,","data:image/jpeg;base64,"]
let imageind = 0;
function Next(){
    if(array.length-1 >imageind )
        imageind++;
    else
        imageind =0;
    image.src = array[imageind];
}
function Prev (){
    if(0<imageind)
         imageind--;
    
    else 
        imageind =array.length-1
    image.src = array[imageind]
    
}
document.querySelectorAll(".btn button")[0].addEventListener("click",Prev)
